PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `achievement_m` (
    `achievement_id` INTEGER NOT NULL,
    `title` TEXT,
    `title_en` TEXT,
    `description` TEXT,
    `description_en` TEXT,
    `achievement_type` INTEGER NOT NULL,
    `reset_type` INTEGER NOT NULL,
    `reset_param` INTEGER,
    `params1` INTEGER,
    `params2` INTEGER,
    `params3` INTEGER,
    `params4` INTEGER,
    `params5` INTEGER,
    `params6` INTEGER,
    `params7` INTEGER,
    `params8` INTEGER,
    `params9` INTEGER,
    `params10` INTEGER,
    `params11` INTEGER,
    `start_date` TEXT NOT NULL,
    `end_date` TEXT,
    `default_open_flag` INTEGER NOT NULL,
    `display_flag` INTEGER NOT NULL,
    `achievement_filter_category_id` INTEGER NOT NULL,
    `achievement_filter_type_id` INTEGER NOT NULL,
    `auto_reward_flag` INTEGER NOT NULL,
    `display_start_date` TEXT,
    `open_condition_string` TEXT,
    `open_condition_string_en` TEXT,
    `term_invisible_flag` INTEGER,
    `release_tag` TEXT,
    PRIMARY KEY (`achievement_id`)
);
CREATE TABLE `achievement_description_m` (
    `achievement_description_id` INTEGER NOT NULL,
    `achievement_type` INTEGER NOT NULL,
    `common_id` INTEGER NOT NULL,
    `description` TEXT NOT NULL,
    `description_en` TEXT,
    PRIMARY KEY (`achievement_description_id`)
);
CREATE TABLE `achievement_unit_group_m` (
    `achievement_unit_group_id` INTEGER NOT NULL,
    `unit_id` INTEGER NOT NULL,
    `rank` INTEGER NOT NULL,
    PRIMARY KEY (`achievement_unit_group_id`,`unit_id`)
);
CREATE TABLE `achievement_unit_group_name_m` (
    `achievement_unit_group_id` INTEGER NOT NULL,
    `name` TEXT NOT NULL,
    `name_en` TEXT,
    PRIMARY KEY (`achievement_unit_group_id`)
);
CREATE TABLE `achievement_unit_type_group_m` (
    `achievement_unit_type_group_id` INTEGER NOT NULL,
    `unit_type_id` INTEGER NOT NULL,
    `rank` INTEGER NOT NULL,
    PRIMARY KEY (`achievement_unit_type_group_id`,`unit_type_id`)
);
CREATE TABLE `achievement_unit_type_group_name_m` (
    `achievement_unit_type_group_id` INTEGER NOT NULL,
    `name` TEXT NOT NULL,
    `name_en` TEXT,
    PRIMARY KEY (`achievement_unit_type_group_id`)
);
CREATE TABLE `achievement_story_m` (
    `achievement_id` INTEGER NOT NULL,
    `next_achievement_id` INTEGER NOT NULL,
    PRIMARY KEY (`achievement_id`,`next_achievement_id`)
);
CREATE TABLE `achievement_category_m` (
    `achievement_category_id` INTEGER NOT NULL,
    `start_date` TEXT,
    `end_date` TEXT,
    `display_flag` INTEGER NOT NULL,
    `release_tag` TEXT,
    PRIMARY KEY (`achievement_category_id`)
);
CREATE TABLE `achievement_tag_m` (
    `achievement_id` INTEGER NOT NULL,
    `achievement_category_id` INTEGER NOT NULL,
    PRIMARY KEY (`achievement_id`,`achievement_category_id`)
);
CREATE TABLE `achievement_aslink_m` (
    `achievement_id` INTEGER NOT NULL,
    PRIMARY KEY (`achievement_id`)
);
CREATE TABLE `klab_id_task_m` (
    `klab_id_task_id` INTEGER NOT NULL,
    `title` TEXT NOT NULL,
    `title_en` TEXT,
    `description` TEXT NOT NULL,
    `description_en` TEXT,
    `condition_type` INTEGER NOT NULL,
    `condition_params` TEXT,
    `condition_count` INTEGER NOT NULL,
    `category_id` INTEGER NOT NULL,
    `reward_group_id` INTEGER NOT NULL,
    `achievement_filter_category_id` INTEGER NOT NULL,
    `achievement_filter_type_id` INTEGER NOT NULL,
    `auto_reward_flag` INTEGER NOT NULL,
    `display_start_date` TEXT,
    `open_condition_string` TEXT,
    `open_condition_string_en` TEXT,
    `start_date` TEXT NOT NULL,
    `end_date` TEXT,
    `release_tag` TEXT,
    PRIMARY KEY (`klab_id_task_id`)
);
CREATE TABLE `achievement_filter_category_m` (
    `achievement_filter_category_id` INTEGER NOT NULL,
    `name` TEXT,
    `name_en` TEXT,
    `icon_asset` TEXT,
    `icon_asset_en` TEXT,
    `default_select_flag` INTEGER,
    `release_tag` TEXT,
    PRIMARY KEY (`achievement_filter_category_id`)
);
CREATE TABLE `achievement_filter_type_m` (
    `achievement_filter_type_id` INTEGER NOT NULL,
    `name` TEXT,
    `name_en` TEXT,
    PRIMARY KEY (`achievement_filter_type_id`)
);
COMMIT;
